    return (
        <nav className="Menu">
            <a href="/">
                <img className="Logo" src={Logo} alt="OscarFlix logo"></img>
            </a>
            <a className="ButtonLink" href="/">
                Novo Vídeo
            </a>
        </nav >
    );
}

export default Menu;
